import Link from 'next/link';
const data = [
    {
        id: 10086,
        name: "LOL"
    },
    {
        id: 655,
        name: "Girl"
    }
];

const TestLink = ({data}) => (
    <div>
        <Link href={`/router/test?q=${data.id}`}>
            <a>Link to { data.name } Page</a>
        </Link>
    </div>
);

const Index = () => (
    <div>
        { data.map(item => (
            <TestLink key={item.id} data={item} />
        )) }
    </div>
);

const fuck = () => (
    <div>
        1223
        <Link href={`/router/test?q=123`}>Link to 1 page</Link>
    </div>
)

export default Index;
